const Counteerr = () => {
  const [count, setCount] = useState(0);

  useEffect(() => {
    let timer = setTimeout(() => {
      setCount(count + 1);
    }, 1000);
  });
  return (
    <>
      <h1>I have rendered {count} times</h1>
    </>
  );
};

export default Counteerr;
